(window.webpackJsonp=window.webpackJsonp||[]).push([[3],{220:function(e,a,t){"use strict";t.r(a);t(11),t(12),t(7),t(20),t(19);var s=t(222),n=t(0),r=t.n(n),o=t(216),i=t(215),l=t(136),d=function(e){var a=e.slug,t=e.title,s=e.excerpt,n=e.date;return r.a.createElement("div",{className:"my-5 md:my-8"},r.a.createElement(l.a,{to:"/"+a,className:"no-underline inline-block"},r.a.createElement("h2",{className:"font-black text-xl md:text-3xl text-gray-800 hover:text-blue-700 font-header",dangerouslySetInnerHTML:{__html:t}})),r.a.createElement("div",null,r.a.createElement("div",{className:"text-sm text-gray-700",dangerouslySetInnerHTML:{__html:s}}),r.a.createElement("span",{className:"text-xs text-gray-700 font-body"},n)))},p=t(217);t(223);a.default=function(){var e=s.data.allWordpressPost.edges.map(function(e){return e.node}).map(function(e){var a=e.id,t=e.title,s=e.excerpt,n=e.date;return{id:a,slug:e.slug,title:t,excerpt:Object(p.b)(s),date:Object(p.a)(n)}});return r.a.createElement(o.a,null,r.a.createElement(i.a,{title:"Home"}),e.map(function(e){var a=e.id,t=function(e,a){if(null==e)return{};var t,s,n={},r=Object.keys(e);for(s=0;s<r.length;s++)t=r[s],a.indexOf(t)>=0||(n[t]=e[t]);return n}(e,["id"]);return r.a.createElement(d,Object.assign({key:a},t))}))}},222:function(e){e.exports=JSON.parse('{"data":{"allWordpressPost":{"edges":[{"node":{"id":"4c380ef9-e271-5bbb-b694-223c7a306f54","slug":"mental-toughness","title":"Mental Toughness","excerpt":"<p>It&#8217;s almost mid 2020! Among all the craziness since the beginning of COVID-19, it has been eventful so far. It&#8217;s been almost 2 year since I&#8217;ve graduated, and worked as a Software Engineer. So I suppose it&#8217;s a good time to reflect on what I&#8217;ve learnt, and accomplished so far. Completed the first semester of &hellip; <a href=\\"https://xbili.wordpress.com/2020/05/04/mental-toughness/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Mental Toughness</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2020-05-05T04:38:56.000Z"}},{"node":{"id":"ec2dc9f0-568c-5e99-898b-91438af0bd7d","slug":"the-effective-engineer","title":"The Effective Engineer","excerpt":"<p>Summary of a great book on being productive at work.</p>\\n","date":"2019-02-05T08:20:09.000Z"}},{"node":{"id":"a773b9b2-9253-54d9-a918-6d0c61e95c52","slug":"thats-how-i-got-to-memphis","title":"That&#8217;s How I Got To&nbsp;Memphis","excerpt":"<p>Memphis is a stand-in for wherever you are right now. What it really means is how I got here. (Charlie Skinner &#8211; The Newsroom) 2018 is probably the fastest year I have experienced in my life so far. I am not sure if that could be said for the past 24 years that I have &hellip; <a href=\\"https://xbili.wordpress.com/2018/12/15/thats-how-i-got-to-memphis/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">That&#8217;s How I Got To&nbsp;Memphis</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2018-12-15T21:21:19.000Z"}},{"node":{"id":"265c563d-1eb0-51b9-89f5-76e7266d8060","slug":"500-days-of-summer","title":"500 (?) Days of&nbsp;Summer","excerpt":"<p>It&#8217;s good to be writing again. While the title above is that of a romantic love movie, I am writing a plan for my first ever relatively relaxed summer. My internship did not turn out the way I&#8217;d like them to and now I&#8217;m left with approximately 3 months to rest and work on more &hellip; <a href=\\"https://xbili.wordpress.com/2017/05/15/500-days-of-summer/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">500 (?) Days of&nbsp;Summer</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2017-05-14T16:49:38.000Z"}},{"node":{"id":"6acdb7d5-b988-534e-8f3d-6020736e8b50","slug":"stop-wasting-time","title":"&#8220;Stop Wasting Time&#8221;","excerpt":"<p>A month into life in Silicon Valley and I find myself wasting too much time on things that don&#8217;t matter. I don&#8217;t feel like I am making full use of my time in a productive manner. As a result here are a few of the things I would want to focus more on. Level up &hellip; <a href=\\"https://xbili.wordpress.com/2016/02/21/stop-wasting-time/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">&#8220;Stop Wasting Time&#8221;</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2016-02-21T04:14:51.000Z"}},{"node":{"id":"7c5d1c5c-5507-5069-b611-341aee2aca90","slug":"silicon-valley","title":"Silicon Valley","excerpt":"<p>The past two weeks of NOC has been a whirlwind ride. It stretches from looking for housing to finally settling down. There was a bit of drama here and there, but I am glad that we’re all settled down nicely now. Having heard so many stories about NOC, I have experienced for myself the struggle &hellip; <a href=\\"https://xbili.wordpress.com/2016/01/21/silicon-valley/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Silicon Valley</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2016-01-20T17:31:55.000Z"}},{"node":{"id":"4929b1e8-e096-57cf-954a-5d0e2b80722a","slug":"noc-prelude","title":"NOC: Prelude","excerpt":"<p>As most of you already know, I departed for NOC a day ago. It still feels pretty surreal that I am here in Silicon Valley, where I dreamed of going ever since I fell in love with programming. I think it&#8217;s important to set the goals and aspirations straight for NOC. It&#8217;s a very unique &hellip; <a href=\\"https://xbili.wordpress.com/2015/12/30/noc-prelude/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">NOC: Prelude</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-12-29T20:41:47.000Z"}},{"node":{"id":"ab9be653-fec0-513b-8843-5e7b69bc1308","slug":"y2s1-a-whirlwind-ride","title":"Y2S1 &#8211; A Whirlwind&nbsp;Ride","excerpt":"<p>Results came out earlier today and I wouldn&#8217;t say I&#8217;m very satisfied with them. The entire semester has been a whirlwind ride, here are some reflections. Work is manageable, time isn&#8217;t. This has to be the greatest lesson learnt. Modules are actually pretty straightforward and easy to understand if I had put in consistent effort &hellip; <a href=\\"https://xbili.wordpress.com/2015/12/22/y2s1-a-whirlwind-ride/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Y2S1 &#8211; A Whirlwind&nbsp;Ride</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-12-22T08:26:19.000Z"}},{"node":{"id":"ea8080df-68d2-5d0f-813e-fe50f9a1dc79","slug":"api-rate-limiting","title":"API Rate Limiting","excerpt":"<p>Since WordPress&#8217;s new admin site is so awesome &lt;insert emoji with heart eyes&gt;, I think I should document my little learning notes here instead. Shall use a sub-domain for this WordPress in time to come! Letterbox&#8217;s traffic went a bit off today, causing our instance&#8217;s CPU usage to spike. Apparently people were spamming API calls to &hellip; <a href=\\"https://xbili.wordpress.com/2015/11/26/api-rate-limiting/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">API Rate Limiting</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-11-26T15:38:46.000Z"}},{"node":{"id":"886228ae-5433-5f50-a6dd-cc9198a9561b","slug":"where-the-actual-learning-takes-place","title":"Where the Actual Learning Takes&nbsp;Place","excerpt":"<p>Just came back from lunch in a pretty cool suite and it gave me a little musing/flashback. As my Economic teacher in Junior College used to tell us when we&#8217;re in the middle of a chaotic discussion about any concepts: Go ahead. Discuss. This is where the actual learning takes place. It&#8217;s been three semesters in &hellip; <a href=\\"https://xbili.wordpress.com/2015/11/26/where-the-actual-learning-takes-place/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Where the Actual Learning Takes&nbsp;Place</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-11-26T06:18:49.000Z"}},{"node":{"id":"8d0ddd51-d90a-550c-9e4c-a24b129b4154","slug":"cs3216-post-mortem","title":"CS3216 Post Mortem","excerpt":"<p>It was a bold decision to take this module in the first semester of my second year, and I certainly do not regret it. Not many people are given this opportunity and I certainly learned much much more from this module than all other modules combined. That being said, I am probably very screwed for finals. The &hellip; <a href=\\"https://xbili.wordpress.com/2015/11/21/cs3216-post-mortem/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">CS3216 Post Mortem</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-11-21T07:15:14.000Z"}},{"node":{"id":"5114c9bf-1442-5c38-8d17-5b1f2c4cec1c","slug":"oh-im-a-mess-right-now-inside-out","title":"Oh I&#8217;m a mess right now, inside&nbsp;out.","excerpt":"<p>It&#8217;s only after recess week and my semester just took a turn for the worst. A series of events happened and I really feel bad about the way I took it in my stride. First of all, midterm results were not satisfactory. I performed slightly below average for both papers. Given that I only had &hellip; <a href=\\"https://xbili.wordpress.com/2015/10/11/oh-im-a-mess-right-now-inside-out/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Oh I&#8217;m a mess right now, inside&nbsp;out.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-10-11T07:13:11.000Z"}},{"node":{"id":"730eb392-ccc6-542f-a10c-bdb3926cd8df","slug":"half-time-once-more","title":"Half-time, once more.","excerpt":"<p>It&#8217;s the semester&#8217;s half-time again. This time I didn&#8217;t spend it studying my ass off in school. I actually did project after project and went home for a break. Having only two papers next week, I feel strangely confident. That&#8217;s a bad thing. I have a tendency to stay in school most weekends for fear of &hellip; <a href=\\"https://xbili.wordpress.com/2015/09/28/half-time-once-more/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Half-time, once more.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-09-27T16:31:35.000Z"}},{"node":{"id":"a5850dd1-5bc4-5e57-80e7-4c23fb86b628","slug":"restructure","title":"Restructure","excerpt":"<p>I wrote about not treating school seriously previously and felt that maybe it is time to do some life restructuring. It&#8217;s already 3 weeks into school but I don&#8217;t feel like I&#8217;ve learnt or achieved much at all. I need to tidy up what&#8217;s currently on my plate since I have so many things to juggle &hellip; <a href=\\"https://xbili.wordpress.com/2015/08/30/restructure/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Restructure</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-08-30T11:04:09.000Z"}},{"node":{"id":"d8ac7a58-a103-5b0e-b564-4f326cba8027","slug":"learning-through-mistakes","title":"Learning Through Mistakes","excerpt":"<p>Just came back from a CS3216 talk on Growth Hacking by Zopim&#8217;s Bjorn (very cool name I swear) and Wei Xiang. It was a pretty inspiring and relatable talk especially after I completed an internship at a growing startup. One of the more relatable point that was mentioned is learning through mistakes. Several questions were brought &hellip; <a href=\\"https://xbili.wordpress.com/2015/08/24/learning-through-mistakes/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Learning Through Mistakes</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-08-24T14:42:11.000Z"}},{"node":{"id":"4db6cc13-c16b-590b-99b2-97bb77f990d7","slug":"shopback-post-mortem","title":"ShopBack Post Mortem","excerpt":"<p>Well I didn&#8217;t exactly die in ShopBack, but I&#8217;d want to document what I&#8217;ve experienced from the 3 months spent here. My official end date is next week and I think it&#8217;s the right time to do some reflection (again). I like to split what I&#8217;ve learnt into three different categories. Mainly: Software Engineering Business Operations &hellip; <a href=\\"https://xbili.wordpress.com/2015/08/08/shopback-post-mortem/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">ShopBack Post Mortem</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-08-07T20:02:33.000Z"}},{"node":{"id":"da3668b3-fe15-50e2-bd9a-d80ce755543f","slug":"goodbye-summer-hello-year-2","title":"Goodbye Summer, Hello Year&nbsp;2!","excerpt":"<p>Summer is coming to an end soon and I&#8217;ve grown so much both as a person and as an engineer. School is starting in a mere 2 weeks&#8217; time and here&#8217;s what I hope to achieve for my Sophomore year&#8217;s first semester! CS3216: Software Engineering on Evolving Platforms This shall be the love of my &hellip; <a href=\\"https://xbili.wordpress.com/2015/07/28/goodbye-summer-hello-year-2/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Goodbye Summer, Hello Year&nbsp;2!</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-07-27T16:51:41.000Z"}},{"node":{"id":"286aa1c1-2811-562c-8e5a-72bb9b275735","slug":"engineers-cannot-panic","title":"&#8220;Engineers Cannot Panic&#8221;","excerpt":"<p>This is probably one of the most important lesson learnt so far for my summer internship. After writing code for so long, it should be ingrained into me that software breaks all the time.  As a new developer, I panic very easily. I will not think properly and logically, and as a result breaking more things &hellip; <a href=\\"https://xbili.wordpress.com/2015/07/09/engineers-cannot-panic/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">&#8220;Engineers Cannot Panic&#8221;</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-07-08T16:59:24.000Z"}},{"node":{"id":"9611523a-86f8-5c4f-b430-eef4d0c60554","slug":"if-theres-one-thing-you-could-change-about-your-internship","title":"If there&#8217;s one thing you could change about your&nbsp;internship","excerpt":"<p>What would it be? David, our senior engineer, posed this question to me today over dinner and I honestly didn&#8217;t know the answer. I may be stagnating after a month of really fast paced work. Now that things are starting to settle, I find myself learning at a slower rate. Maybe it&#8217;s time to force &hellip; <a href=\\"https://xbili.wordpress.com/2015/06/16/if-theres-one-thing-you-could-change-about-your-internship/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">If there&#8217;s one thing you could change about your&nbsp;internship</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-06-15T17:09:58.000Z"}},{"node":{"id":"83663372-3eb1-5cf2-884a-4f5a4ee0ee89","slug":"two-weeks-into-internship","title":"Two weeks into&nbsp;Internship","excerpt":"<p>Half a month into my internship and I&#8217;m pretty overwhelmed by the amount of things I&#8217;ve learnt. I&#8217;ve never been exposed to a large (and to some extent, messy) codebase and be expected to understand how it works in a single week. In addition, the work I&#8217;m doing right now brings me great satisfaction. I should &hellip; <a href=\\"https://xbili.wordpress.com/2015/05/31/two-weeks-into-internship/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Two weeks into&nbsp;Internship</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-05-31T07:02:49.000Z"}},{"node":{"id":"4a851b7a-e302-5a54-9375-c16a3304f2d6","slug":"summer-internship","title":"Summer Internship","excerpt":"<p>After a couple of interviews, I&#8217;ve finally decided on my summer plan. It&#8217;ll be a 3 month internship at ShopBack, focusing mainly on frontend development. 3 months will fly by in the blink of an eye and here&#8217;s what I wish to gain from the internship: Level Up as a Developer This should be my main goal. &hellip; <a href=\\"https://xbili.wordpress.com/2015/05/16/summer-internship/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Summer Internship</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-05-16T15:55:04.000Z"}},{"node":{"id":"af0dab9a-2a18-577f-b742-1c4db7c2f5b2","slug":"negotiation","title":"Negotiation","excerpt":"<p>In an attempt to expand my toolbox, I decided to take part in my college&#8217;s negotiation workshop. It was 3-day long and really intense. Nonetheless it was an experience worth having. It is not possible to summarise everything that I&#8217;ve learnt in the past three days, but here are the main takeaways. Claiming &amp; Creating Value &hellip; <a href=\\"https://xbili.wordpress.com/2015/05/10/negotiation/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Negotiation</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-05-10T15:35:44.000Z"}},{"node":{"id":"e5b68333-7c57-5d19-b98f-031768130879","slug":"end-of-freshman-year","title":"End of Freshman&nbsp;Year","excerpt":"<p>I just had my last examination today and here&#8217;s to the end of my freshman year. I think it&#8217;s always a good idea to sum up what I have learnt, and reflect on what could be done even better. CS2020: Data Structures and Algorithms (Accelerated) &#8211; 6MCs The main highlight of this semester. Not as &hellip; <a href=\\"https://xbili.wordpress.com/2015/05/01/end-of-freshman-year/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">End of Freshman&nbsp;Year</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-04-30T16:13:25.000Z"}},{"node":{"id":"76575e4d-96f8-56b6-b39d-00f2edf48533","slug":"correct-decisions-are-never-easy-to-make","title":"Correct Decisions are Never Easy to&nbsp;Make","excerpt":"<p>I&#8217;ve just made a decision which I never thought I&#8217;d make. It was for a really personal matter, but through it all I believe I have matured a little bit more. Correct decisions are never easy to make. Be it in the workplace, school or our daily lives. Perhaps taking a nap sounds better than &hellip; <a href=\\"https://xbili.wordpress.com/2015/04/25/correct-decisions-are-never-easy-to-make/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Correct Decisions are Never Easy to&nbsp;Make</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-04-25T07:30:39.000Z"}},{"node":{"id":"8cf62641-0491-5668-b7c0-85da0b82d070","slug":"presentations","title":"Presentations","excerpt":"<p>I decided to give presentations a try since I&#8217;ve never been really good at it. It was pretty fortunate that I was given the opportunity to present in a lecture to CP3101B students about my experiences contributing to NUSMods. There&#8217;re a few lessons learnt from the short 5 minutes. Speak slowly. I spoke too fast &hellip; <a href=\\"https://xbili.wordpress.com/2015/04/02/presentations/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Presentations</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-04-02T14:27:02.000Z"}},{"node":{"id":"f4d58ead-0e22-5390-80e1-2906b92b89e9","slug":"13am-musings","title":"13AM musings","excerpt":"<p>I just came back from my algorithm coding quiz today and feel totally stumped. It was an easy paper, I thought I had it in the bag&#8230; But I clearly did not. Whenever things start to veer into the direction of hard work not paying off, I think it&#8217;s good to reflect on quality of &hellip; <a href=\\"https://xbili.wordpress.com/2015/03/20/13am-musings/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">13AM musings</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-03-19T16:44:53.000Z"}},{"node":{"id":"c01e16e2-7980-5d87-ac5f-2badd95f6e4b","slug":"second-hackathon-thoughts","title":"Second Hackathon Thoughts","excerpt":"<p>A while ago I wrote a post about my first hackathon experience at HacknRoll by NUSHackers. Just yesterday, I participated in Emirates Travel Hackathon, co-organized by Web In Travel (WIT). The experience this time was much more fulfilling than the previous. From the ideation to execution, there were key takeaways in every phase. We built Big Brother, which &hellip; <a href=\\"https://xbili.wordpress.com/2015/03/15/second-hackathon-thoughts/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Second Hackathon Thoughts</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-03-15T14:20:41.000Z"}},{"node":{"id":"8c8b1845-3cd4-5912-beb9-a12faf43436c","slug":"2015-experiences","title":"Build Character","excerpt":"<p>3 days into 2015, and I&#8217;ve had two interesting experiences. Jumpstarting a car. This actually happened on New Year&#8217;s Eve. Darren actually forgotten to turn off his hazard lights after parking. So while we were happily having Korean BBQ, his car was flashing away. The battery was flat when we returned. It was our first &hellip; <a href=\\"https://xbili.wordpress.com/2015/01/03/2015-experiences/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Build Character</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2015-01-03T15:23:44.000Z"}},{"node":{"id":"efc09e0a-fc8e-5b8c-9691-fbca13d5121d","slug":"semester-break-so-far","title":"Semester Break So&nbsp;Far","excerpt":"<p>4 weeks into semester break and here&#8217;s what I&#8217;ve done: Shipped Ecomore Corp: One of the greatest accomplishment is to see your crafted project go up online, even if there&#8217;s not much people viewing it. I&#8217;ve spent quite a bit of time making sure certain features work, and nothing beats the feeling of uploading the &hellip; <a href=\\"https://xbili.wordpress.com/2014/12/27/semester-break-so-far/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Semester Break So&nbsp;Far</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-12-27T04:34:40.000Z"}},{"node":{"id":"f63f8b59-9b6f-5c04-aac9-2e012e122176","slug":"results-and-a-2014-wrap-up","title":"Results, and a 2014&nbsp;Wrap-Up","excerpt":"<p>It&#8217;s the time of the year again. A time to look back at all the moments and achievements, also at all the missed opportunities and failures. But before I go into that. Results just got released today. I did pretty okay, considering that both of my As came from my CS modules. Well let me just &hellip; <a href=\\"https://xbili.wordpress.com/2014/12/23/results-and-a-2014-wrap-up/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Results, and a 2014&nbsp;Wrap-Up</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-12-23T15:56:18.000Z"}},{"node":{"id":"d685643b-b818-535c-92ad-261768181cb3","slug":"recess-and-code-golf","title":"Recess, and Code&nbsp;Golf.","excerpt":"<p>It&#8217;s recess week! Also known as the week of pure studying for mid terms, at least for us CS students. To start the recess week off proper, I attended a Code Golf session by NUSHackers. It sort of show me how detached I am from recreational programming. Lately CS1101S is getting more intense, and I&#8217;m &hellip; <a href=\\"https://xbili.wordpress.com/2014/09/19/recess-and-code-golf/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Recess, and Code&nbsp;Golf.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-09-19T14:31:28.000Z"}},{"node":{"id":"a374d8b3-f021-5185-ba7f-bd3190a59a56","slug":"week-4-and-beyond","title":"Week 4, and&nbsp;beyond.","excerpt":"<p>Week 4 has just ended, and it&#8217;s 2 more weeks to recess week, 3 more to midterms. That&#8217;s really very, very fast. Where did all the time go? Newton&#8217;s first law explains this very well. I read an article recently about how the laws of physics can be related to productivity, and this is exactly &hellip; <a href=\\"https://xbili.wordpress.com/2014/09/06/week-4-and-beyond/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Week 4, and&nbsp;beyond.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-09-06T07:31:28.000Z"}},{"node":{"id":"872d5644-60e4-581a-aa66-43e4c2eec851","slug":"being-an-underdog-intentionally","title":"Being an underdog,&nbsp;intentionally.","excerpt":"<p>School is officially starting tomorrow. I&#8217;ve went through my previous posts (once more) and figured how far I&#8217;ve come, and how long I&#8217;ve waited for this moment. But now that school is really starting, there is an overwhelming sense of loss.  It&#8217;s time to be a student again.  After a short get together with Hume &hellip; <a href=\\"https://xbili.wordpress.com/2014/08/10/being-an-underdog-intentionally/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Being an underdog,&nbsp;intentionally.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-08-10T15:55:22.000Z"}},{"node":{"id":"b8820bde-3a39-5297-8f94-422d57bf5d07","slug":"new-room-new-beginning","title":"New room, new&nbsp;beginning.","excerpt":"<p>I&#8217;ve moved in to Tembusu College, finally. I&#8217;m staying really, really high up on the 19th floor. Pros and cons of staying so high up. Well but the pros definitely outweigh the cons. Sadly most of my friends are staying in the lower levels. 😦 We&#8217;re still neighbours though, living in the same block! So &hellip; <a href=\\"https://xbili.wordpress.com/2014/08/04/new-room-new-beginning/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">New room, new&nbsp;beginning.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-08-04T15:14:04.000Z"}},{"node":{"id":"308df532-014d-5326-900f-a921ec38c790","slug":"technical-interviews-and-debates","title":"Technical Interviews and&nbsp;debates.","excerpt":"<p>Yesterday marked the last day of Tembusu Orientation Week, and it was a totally different experience of freshmen camp. In my opinion, camaraderie and friendship forged during the camp was more important than the camp itself. I&#8217;m really proud to be part of this amazing OG, Hume! #NoPlaceLikeHUME Other than the amazing friends made, I&#8217;ve &hellip; <a href=\\"https://xbili.wordpress.com/2014/07/26/technical-interviews-and-debates/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Technical Interviews and&nbsp;debates.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-07-26T02:42:54.000Z"}},{"node":{"id":"0bec4582-764c-59ff-9bf5-9a40cfcbbd25","slug":"keep-up-the-learning","title":"Keep up the&nbsp;learning.","excerpt":"<p>I am hitting a plateau. It could mean a lot of things when I&#8217;ve reached a plateau.  Firstly, it could mean that I am getting good at what I do. Which leads to what I like to call a pro comfort zone. It&#8217;s the nirvana of what you&#8217;ve been working for. The highest level of your skill. Obviously, &hellip; <a href=\\"https://xbili.wordpress.com/2014/07/13/keep-up-the-learning/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Keep up the&nbsp;learning.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-07-13T15:20:16.000Z"}},{"node":{"id":"d48b98fa-f294-5ce8-8a99-bca74cfd5951","slug":"where-do-we-go-from-here","title":"Where do we go from&nbsp;here?","excerpt":"<p>I was lazing in bed this morning, when the long awaited acceptance email from Tembusu College came.  I made it.  They had accepted me. I do believe that after all the reflections and lessons learnt, this is the fruit of my labour. But what&#8217;s more important is to view this not as a destination, but &hellip; <a href=\\"https://xbili.wordpress.com/2014/07/08/where-do-we-go-from-here/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Where do we go from&nbsp;here?</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-07-08T03:39:36.000Z"}},{"node":{"id":"12c63737-4609-5c71-816d-09e0d4789b2e","slug":"suck-less","title":"Suck less.","excerpt":"<p>I&#8217;ve went for my first IFG basketball &#8220;get together&#8221; yesterday, and it was surely disappointing. Not in a sense that it wasn&#8217;t fun, but it&#8217;s hard to admit, I still suck at this sport.  Despite all the effort put in to make sure I can shoot a lay-up properly, or make the easy open shots, I &hellip; <a href=\\"https://xbili.wordpress.com/2014/06/28/suck-less/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Suck less.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-06-28T06:36:56.000Z"}},{"node":{"id":"f38c2c39-116f-5871-848c-651a13b0d85d","slug":"post-camp-syndrome","title":"Post Camp Syndrome","excerpt":"<p>I just came back from Freshmen Social Camp a few days ago, and boy it was helluva camp. (Despite the fact that I got down with fever and sore throat the second day I came home) Back to reality though, I realise that I&#8217;m pit against some of the best in NUS, and it&#8217;s not &hellip; <a href=\\"https://xbili.wordpress.com/2014/06/20/post-camp-syndrome/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Post Camp Syndrome</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-06-20T09:09:21.000Z"}},{"node":{"id":"47db663d-b70e-55b0-b210-cdfe6c84808c","slug":"relax","title":"Relax.","excerpt":"<p>I have just submitted my UTCP application. After what happened with my USP application, I learnt a really valuable lesson. Relax.  I&#8217;ve been unable to sleep days before my USP interview. On the day of interview, I arrived too early at Cinnamon and was in a total mess. I look fine on the outside, but &hellip; <a href=\\"https://xbili.wordpress.com/2014/06/01/relax/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Relax.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-06-01T13:14:27.000Z"}},{"node":{"id":"f04d11ce-4722-5094-9e85-846b7364320a","slug":"rejection","title":"Rejection.","excerpt":"<p>I just got the rejection email from USP this morning while enjoying my daily cup of coffee. My heart sank. But I told myself, Savor the taste of failure, grow and learn from it.  It is not the end of the world yet, I still have other options for a more holistic education. Tembusu and College &hellip; <a href=\\"https://xbili.wordpress.com/2014/05/23/rejection/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Rejection.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-05-23T04:06:18.000Z"}},{"node":{"id":"62f0bc12-64cd-55e0-9ebf-18e8166b5c7f","slug":"learning-to-sell-myself-better","title":"Learning to sell myself&nbsp;better.","excerpt":"<p>I believe I have a problem of feeling inferior, and not selling the complete image of myself to others. When I say &#8216;sell myself&#8217;, it does not refer to prostitution. Rather, it refers to the ability to show others what kind of person you are.  After reflecting how the USP interview went with my parents, &hellip; <a href=\\"https://xbili.wordpress.com/2014/05/22/learning-to-sell-myself-better/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Learning to sell myself&nbsp;better.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-05-22T05:48:59.000Z"}},{"node":{"id":"ffd9d7d6-0e0b-5f82-871c-63cca4f0322e","slug":"good-enough","title":"Good Enough","excerpt":"<p>I just browsed through a few blog articles about other people’s learning tips and experience, and it dawned upon me that everyone who gives a damn about themselves, are striving to begood enough. It probably takes some pressure off that I’ll be pit against some of the brightest and smartest people in NUS, and it’ll be more so the &hellip; <a href=\\"https://xbili.wordpress.com/2014/05/06/good-enough/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Good Enough</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-05-06T05:19:56.000Z"}},{"node":{"id":"df3b5eba-2247-525f-887b-fcd14371b91e","slug":"interviews-i-never-had-a-problem-with-them","title":"Interviews, I never had a problem with&nbsp;them.","excerpt":"<p>Until I applied for my first job. The question was &#8220;Tell me more about yourself.&#8221;  &#8220;Hi, I&#8217;m Bili&#8221; was my response. *major facepalm* (Yes, I got rejected) Tomorrow is going to be another interview, for NUS University Scholar&#8217;s Programme. I&#8217;ve learnt my lesson to prepare for interviews, and I sure did this time. More importantly, &hellip; <a href=\\"https://xbili.wordpress.com/2014/04/29/interviews-i-never-had-a-problem-with-them/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Interviews, I never had a problem with&nbsp;them.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-04-29T13:40:46.000Z"}},{"node":{"id":"1ff7b81f-f3b7-5809-b077-dfe43f128260","slug":"pre-university-preperation","title":"Pre-University Preperation","excerpt":"<p>It&#8217;s been a while since I&#8217;ve written anything here, but I&#8217;ve been updating Quora quite frequently, do check out my recent travel diaries, and also a project diary here! From now till school starts, it will be hell of a ride. I&#8217;ve got a trip to China from 9th May to 20th May, after which &hellip; <a href=\\"https://xbili.wordpress.com/2014/04/23/pre-university-preperation/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Pre-University Preperation</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-04-23T03:51:23.000Z"}},{"node":{"id":"09e204ef-38df-5c4e-8283-252ddf1d56a9","slug":"hobbies","title":"Hobbies.","excerpt":"<p>Everyone has got to have a hobby, right? Recently I&#8217;ve developed an interest for two things, photography, and RC helicopters. First up, Photography. I&#8217;m going to Chicago pretty soon in mid-March to visit my aunt, and at the same time help her out with a small project which has a bit of coding and design involved. &hellip; <a href=\\"https://xbili.wordpress.com/2014/02/17/hobbies/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Hobbies.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2014-02-17T11:28:02.000Z"}},{"node":{"id":"b213c456-41d4-5897-ba14-7fb26f13f535","slug":"daily-coding-plan","title":"Daily Coding Plan","excerpt":"<p>It&#8217;s the end of the year, and while everyone is busy doing up their 2013 reflections and 2014 resolutions, I&#8217;m here to construct an effective coding plan for myself. I discussed with my friend recently and came to a conclusion that I&#8217;ve been coding daily, but have not been making (significant) progress. It&#8217;s probably because &hellip; <a href=\\"https://xbili.wordpress.com/2013/12/31/daily-coding-plan/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Daily Coding Plan</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-12-31T15:29:25.000Z"}},{"node":{"id":"f15abb12-ce78-57e2-9e02-99e5246f797c","slug":"learning-alone-is-really-tough","title":"Learning alone is really&nbsp;tough&#8230;","excerpt":"<p>But it&#8217;s the only road that I could take for now, NUS hackerschool went on hiatus due to the school holidays and, yeah that was basically the only place where I talked to someone else about coding.  I finished problem set 4 of Harvard&#8217;s CS50, and I guess I&#8217;ve made a great leap forward by &hellip; <a href=\\"https://xbili.wordpress.com/2013/12/22/learning-alone-is-really-tough/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Learning alone is really&nbsp;tough&#8230;</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-12-21T16:31:29.000Z"}},{"node":{"id":"c3fc6909-6ee1-54e5-88d4-104ff093e9cc","slug":"reserve","title":"Reserve.","excerpt":"<p>I&#8217;m not a &#8216;sports person&#8217;, but I somehow decided to join swimming for my division&#8217;s Sports Day. Well, it was a great experience overall, despite the fact that I was only a reserve in the end. Couple of reasons why I really enjoyed past month training for this event: Keeps me exercising everyday! I think it&#8217;s &hellip; <a href=\\"https://xbili.wordpress.com/2013/11/27/reserve/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Reserve.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-11-27T10:42:22.000Z"}},{"node":{"id":"585e31aa-8359-5d24-85fb-7aa51cb85ae9","slug":"effective-studying-methods","title":"Effective studying methods","excerpt":"<p>Came across this useful article on the web: The Art of Stealth Studying: How To Earn a 4.0 With Only 1.0 Hours of Work It is these simple things in life that people find and make a difference in that will differentiate the best from the best.</p>\\n","date":"2013-11-25T14:54:43.000Z"}},{"node":{"id":"4ce83156-aa6b-5a6d-95fc-0bf2591876d8","slug":"its-november","title":"It&#8217;s November.","excerpt":"<p>What a lame and boring title, right?  It isn&#8217;t for me. November signifies yet another month closer to ORD. It also reminded me of how long have I been coding, and how much I&#8217;ve improved. So, without further ado&#8230;  I built a Griddler app for my unit. It was just a small project which I wanted &hellip; <a href=\\"https://xbili.wordpress.com/2013/11/19/its-november/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">It&#8217;s November.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-11-19T14:31:37.000Z"}},{"node":{"id":"79a34b17-a5fc-5a6d-9753-f0ace1142fd1","slug":"due-for-an-update","title":"Due for an&nbsp;update","excerpt":"<p>I&#8217;m back with an update for what&#8217;s up lately. A few things! First, I&#8217;m focusing a lot on C++ depth.I brought my Primer C++ textbook into camp, so that I could focus on a topic a day, be it the basic arrays/variables, or the advanced classes and polymorphism. Learning something new a day would really &hellip; <a href=\\"https://xbili.wordpress.com/2013/10/02/due-for-an-update/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Due for an&nbsp;update</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-10-02T13:15:14.000Z"}},{"node":{"id":"0aaceb29-3968-55bf-a3cf-f1d512dab296","slug":"hackerschool-my-weekly-remedy","title":"Hackerschool, my weekly&nbsp;remedy.","excerpt":"<p>I&#8217;ve just came back from hackerschool, a really great programme by NUSHackers. I&#8217;ve been to two sessions so far, learnt some basic git and Expressjs (though I admit I really still suck at Expressjs, gotta play around with it more) The past two weeks was really hectic. A parade that included two days of rehearsals, &hellip; <a href=\\"https://xbili.wordpress.com/2013/09/14/hackerschool-my-weekly-remedy/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Hackerschool, my weekly&nbsp;remedy.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-09-14T12:25:19.000Z"}},{"node":{"id":"4b2451f8-4f66-5627-884f-3454e54239d0","slug":"across-clear-skies-among-glowing-stars-thats-where-ill-find-us","title":"Across clear skies. Among glowing stars. That&#8217;s where I&#8217;ll find&nbsp;us.","excerpt":"<p>Title was just a quote from a WongFu video which I really enjoy watching. Just watched &#8216;The Internship&#8217; just now. Caught it alone because, I didn&#8217;t know why too. Was supposed to catch it with a good friend of mine. But I decided I should catch it alone first. It was a really good movie &hellip; <a href=\\"https://xbili.wordpress.com/2013/08/28/across-clear-skies-among-glowing-stars-thats-where-ill-find-us/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Across clear skies. Among glowing stars. That&#8217;s where I&#8217;ll find&nbsp;us.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-08-28T13:56:16.000Z"}},{"node":{"id":"8d26e968-d98a-5d4e-b1c9-b9fa387dd7f3","slug":"humble-beginnings","title":"Humble Beginnings","excerpt":"<p>I am here again, trying to pen down all of my thoughts so far. I started this WordPress site at almost the same time I started to learn coding, and to see how far I&#8217;ve come, it&#8217;s great. Honestly, I admit that I still do not know most of C++&#8217;s utilities, despite playing around with &hellip; <a href=\\"https://xbili.wordpress.com/2013/08/25/humble-beginnings/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Humble Beginnings</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-08-25T12:47:56.000Z"}},{"node":{"id":"6aee7a84-2f96-5d15-8ef8-b5200ffead8a","slug":"focus","title":"Focus.","excerpt":"<p>I haven&#8217;t really been focusing lately, mostly due to the fact that I fell sick. Bili&#8217;s self-diagnosis would say that it&#8217;s a case of chronic sinusitis, but I wouldn&#8217;t be able to confirm that until I visit the ENT specialist this coming Thursday. I came to the point where I am not doing anything, at &hellip; <a href=\\"https://xbili.wordpress.com/2013/07/28/focus/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Focus.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-07-28T13:54:16.000Z"}},{"node":{"id":"ec4cba83-47fd-53fb-8142-4e064909f49b","slug":"to-do","title":"To-do.","excerpt":"<p>I came up with this idea to create a To-Do list in order to put my new jQuery skills to the test. It wasn&#8217;t really that smooth sailing. As always, I&#8217;m having troubles recalling all of the syntax that I&#8217;ve learnt from the online videos, and also, weak fundamentals. To me, programming is all about &hellip; <a href=\\"https://xbili.wordpress.com/2013/07/11/to-do/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">To-do.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-07-11T14:40:30.000Z"}},{"node":{"id":"d612e596-4dd9-5acf-a161-ce9783888b90","slug":"three","title":"Three.","excerpt":"<p>Yes it&#8217;s been a while and I&#8217;ve made some great progress in coding. Yay! Let&#8217;s begin with the three languages I&#8217;ve played around with recently: C++. Yes, the language which I started with. I never really got to build things with this, but it&#8217;s a sooner or later thing. I&#8217;m still revising this language in order to &hellip; <a href=\\"https://xbili.wordpress.com/2013/07/01/three/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Three.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-07-01T12:39:15.000Z"}},{"node":{"id":"37f48ec0-b088-5623-bfbf-187ba1d364d2","slug":"haze-in-singapore-what-we-should-really-be-doing","title":"Haze in Singapore: What we should really be&nbsp;doing?","excerpt":"<p>I think it&#8217;s been made very clear that all of us are very much affected by the haze, scrolling through numerous tweets and Facebook posts about how bad it is. Many of us attribute this to our neighbouring country. I do not deny that, but let&#8217;s take a step back, and view things in a &hellip; <a href=\\"https://xbili.wordpress.com/2013/06/23/haze-in-singapore-what-we-should-really-be-doing/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Haze in Singapore: What we should really be&nbsp;doing?</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-06-23T08:52:34.000Z"}},{"node":{"id":"1a218f4c-821d-5ed8-8afb-f09ccde47d15","slug":"weather","title":"Weather.","excerpt":"<p>Weather in Singapore is really bad these few days. Considering that the PSI (Pollutant Standards Index) is currently at a record high 290. I&#8217;m coughing really badly. My guess that it was mostly due to my previous episode with flu and cold, which has now evolved into sort of a sore throat and cough. The &hellip; <a href=\\"https://xbili.wordpress.com/2013/06/19/weather/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Weather.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-06-19T13:27:58.000Z"}},{"node":{"id":"624e90ed-1395-5ef3-83ee-09e4118feee1","slug":"new-macbook","title":"New MacBook","excerpt":"<p>It was a beautiful day this morning when I was met with a pleasant surprise. Had to return to camp to settle some &#8220;stuff&#8221; which I shouldn&#8217;t be blogging about. So I won&#8217;t! Okay so here&#8217;s what happened after I returned to camp. Went to Gain City with my dad who picked me up to &hellip; <a href=\\"https://xbili.wordpress.com/2013/06/15/new-macbook/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">New MacBook</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-06-15T10:48:47.000Z"}},{"node":{"id":"bf17f644-9d65-52d2-9354-36f7b1913651","slug":"see-whats-it-like-to-go-google","title":"See what&#8217;s it like to go&nbsp;Google.","excerpt":"<p>Honestly I&#8217;m really impressed by what Google is doing, and has been doing. They&#8217;re making things easier for users by integrating it into a single platform. Yes, probably MSN Live tried to do that once, Facebook tried it too, but nobody did it as good as Google has. Right now, my emails, contacts, calenders, and &hellip; <a href=\\"https://xbili.wordpress.com/2013/06/14/see-whats-it-like-to-go-google/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">See what&#8217;s it like to go&nbsp;Google.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-06-14T09:11:58.000Z"}},{"node":{"id":"efb25c5b-399c-5a89-b98b-800b85e40701","slug":"too-many-things-at-once","title":"Too many things at&nbsp;once.","excerpt":"<p>I went to the library today to borrow a few more books, mainly on coding and scripting. Right now these things have become integrated into part of my life and that&#8217;s exactly what I want to achieve. Immerse myself in an environment where I will be motivated and spurred on to learn more and venture &hellip; <a href=\\"https://xbili.wordpress.com/2013/06/12/too-many-things-at-once/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Too many things at&nbsp;once.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-06-12T13:42:06.000Z"}},{"node":{"id":"8c72b2b0-1c79-5ef5-b5da-bc30f00fc983","slug":"another","title":"Another.","excerpt":"<p>Another weekend just flew by like that. Well I&#8217;ve accomplished quite a lot for this weekend. Managed to cover pointers in C++! It&#8217;s a confusing concept, especially it&#8217;s applications, but I hope to master it by Tuesday. Coding is like math, I need more practice in order to fully understand a concept. I&#8217;m already halfway &hellip; <a href=\\"https://xbili.wordpress.com/2013/06/09/another/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Another.</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-06-09T12:35:25.000Z"}},{"node":{"id":"bbbe5af5-0865-578f-8b40-66f07b208ce1","slug":"what-i-started-off-with","title":"What I started off&nbsp;with&#8230;","excerpt":"<p>I was scrolling through &#8220;The Verge&#8221; forums today and came across this discussion about which language would be the best to start programming with. Many chose HTML5/JavaScript, while some went ahead with Python and Ruby. But me, a person with no background is starting off learning C++. Well, I read also in a comment that &hellip; <a href=\\"https://xbili.wordpress.com/2013/06/04/what-i-started-off-with/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">What I started off&nbsp;with&#8230;</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-06-04T13:33:04.000Z"}},{"node":{"id":"b83d4265-ee71-5328-b734-e935e244f5dd","slug":"stringstream","title":"stringstream","excerpt":"<p>The title is as above because that&#8217;s where I am with C++ right now. It&#8217;s really hard to pick up something from the scratch with nobody to show you the ropes. I&#8217;m doing that now and, honestly if I ever master coding before I ORD from NS, it&#8217;ll be really an achievement. I figure that &hellip; <a href=\\"https://xbili.wordpress.com/2013/06/02/stringstream/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">stringstream</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-06-02T11:57:30.000Z"}},{"node":{"id":"4d06df93-312b-5a1c-b1a9-b1386c656281","slug":"what-the-internet-is-doing-to-our-brains","title":"What the Internet is Doing To Our&nbsp;Brains","excerpt":"<p>Well this is really awkward that this video is on the Internet. But well, this video sparked something in me. Maybe this is exactly what&#8217;s stopping me from performing well lately. I&#8217;ve been on the Internet for way too long&#8230; (And I still am) So right now I should probably start working on two of &hellip; <a href=\\"https://xbili.wordpress.com/2013/05/31/what-the-internet-is-doing-to-our-brains/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">What the Internet is Doing To Our&nbsp;Brains</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-05-31T10:26:08.000Z"}},{"node":{"id":"3224e45c-2e3b-501c-b292-8538b3e59ae4","slug":"why-do-i-do-this","title":"Why do I do&nbsp;this?","excerpt":"<p>I started this website to record down my achievements in life so far. I think it&#8217;s important that we could pen down what we&#8217;ve done and how we feel to refer to in the future. It could do us good in two ways. One, we can laugh about how immature our mind was in the &hellip; <a href=\\"https://xbili.wordpress.com/2013/05/27/why-do-i-do-this/\\" class=\\"more-link\\">Continue reading <span class=\\"screen-reader-text\\">Why do I do&nbsp;this?</span> <span class=\\"meta-nav\\">&rarr;</span></a></p>\\n","date":"2013-05-27T15:43:14.000Z"}}]}}}')}}]);
